POST 

1. Request 
 const req = new Request('/test?foo=1&bar=2', {method: 'POST'});
 this.post(req, console.log );

2. url
 this.post('/test', console.log);

3. urldata
 this.post({
      url: '/test',
      data: { foo:1, bar:2 }
  }, console.log, console.log );

 4. 
 const formData = new FormData();
 formData.append('file1', new File([], 'filename'));
 this.post({
     url: '/upload',
     data: formData
 }, console.log, console.log );

 5. json
 this.post({
     url: '/upload',
     data: {foo:1,bar:2}
     sendAsJson: true
 }, console.log, console.log );

